// Booklist.js
import React from 'react';
import { Link } from 'react-router-dom';
import infoArr from "../../infoArr";

const Booklist = () => {
    return (
        <div>
            {infoArr.map((info, index) => (
                <div key={index}>
                    <Link to={`/book/${index}`}>
                        <img src={info.imageUrl} alt={info.bookName} />
                    </Link>
                    <h1>{info.bookName}</h1>
                </div>
            ))}
        </div>
    );
};

export default Booklist;
